define('text!uikit/css/components/notify.almost-flat.css', ['module'], function(module) { module.exports = "/*! UIkit 2.27.2 | http://www.getuikit.com | (c) 2014 YOOtheme | MIT License */\n/* ========================================================================\n   Component: Notify\n ========================================================================== */\n/*\n * Message container for positioning\n */\n.uk-notify {\n  position: fixed;\n  top: 10px;\n  left: 10px;\n  z-index: 1040;\n  box-sizing: border-box;\n  width: 350px;\n}\n/* Position modifiers\n========================================================================== */\n.uk-notify-top-right,\n.uk-notify-bottom-right {\n  left: auto;\n  right: 10px;\n}\n.uk-notify-top-center,\n.uk-notify-bottom-center {\n  left: 50%;\n  margin-left: -175px;\n}\n.uk-notify-bottom-left,\n.uk-notify-bottom-right,\n.uk-notify-bottom-center {\n  top: auto;\n  bottom: 10px;\n}\n/* Responsiveness\n========================================================================== */\n/* Phones portrait and smaller */\n@media (max-width: 479px) {\n  /*\n     * Fit in small screen\n     */\n  .uk-notify {\n    left: 10px;\n    right: 10px;\n    width: auto;\n    margin: 0;\n  }\n}\n/* Sub-object: `uk-notify-message`\n========================================================================== */\n.uk-notify-message {\n  position: relative;\n  margin-bottom: 10px;\n  padding: 15px;\n  background: #444;\n  color: #fff;\n  font-size: 16px;\n  line-height: 22px;\n  cursor: pointer;\n  border: 1px solid #444;\n  border-radius: 4px;\n}\n/* Close in notify\n ========================================================================== */\n.uk-notify-message > .uk-close {\n  visibility: hidden;\n  float: right;\n}\n.uk-notify-message:hover > .uk-close {\n  visibility: visible;\n}\n/* Modifier: `uk-alert-info`\n ========================================================================== */\n.uk-notify-message-primary {\n  background: #ebf7fd;\n  color: #2d7091;\n  border-color: rgba(45, 112, 145, 0.3);\n}\n/* Modifier: `uk-alert-success`\n ========================================================================== */\n.uk-notify-message-success {\n  background: #f2fae3;\n  color: #659f13;\n  border-color: rgba(101, 159, 19, 0.3);\n}\n/* Modifier: `uk-notify-message-warning`\n ========================================================================== */\n.uk-notify-message-warning {\n  background: #fffceb;\n  color: #e28327;\n  border-color: rgba(226, 131, 39, 0.3);\n}\n/* Modifier: `uk-notify-message-danger`\n ========================================================================== */\n.uk-notify-message-danger {\n  background: #fff1f0;\n  color: #d85030;\n  border-color: rgba(216, 80, 48, 0.3);\n}\n"; });
